    <button className="createBox" onClick={() => prepareSendCreate()} >Create a new entry</button>
    {entries.map((entry) => {return <Entry key={entry._id} id={entry._id} deleteEntry={props.sendDelete} updateCallBack={props.sendUpdate} entry={entry} />})}</div>

  </div>)
}

